to admin email: %s'=>'Introduce los destinatarios (separados por comas) de este correo electrónico. Por defecto se envía al correo electrónico de administración: %s','Email body with merge tag placeholdersSquare sync completed for {site_title} at {sync_completed_date} {sync_completed_time}.'=>'Sincronización con Square completada en {site_title} a las {sync_completed_date} {sync_completed_time}.','Email heading with merge tag placeholderSquare sync completed for {product_count}'=>'Sincronización con Square completada de {product_count}','Email subject[WooCommerce] Square sync completed'=>'[WooCommerce] Sincronización con Square completada','This email is sent once a manual sync has been completed between WooCommerce and Square'=>'Este correo electrónico se envía una vez que se haya completado una sincronización manual entre WooCommerce y Square','Square sync completed'=>'Sincronización con Square completada','If a match is not found, a new product will be created in Square.'=>'Si no se encuentra ninguna coincidencia, se creará un nuevo producto en Square.','If a match is not found in Square, the product will be skipped in the sync.'=>'Si no se encuentra ninguna coincidencia en Square, se omitirá el producto en la sincronización.','If a match is not found in Square, the product will be hidden from the catalog in WooCommerce.'=>'Si no se encuentra ninguna coincidencia en Square, se ocultará el producto del catálogo de WooCommerce.','If a match is found in WooCommerce, product data in Square will be overwritten with WooCommerce data.'=>'Si se encuentra una coincidencia en WooCommerce, los datos del producto de Square se sustituirán por los datos de WooCommerce.','If a match is found in Square, product data in WooCommerce will be overwritten with Square data.'=>'Si se encuentra una coincidencia en Square, los datos del producto en WooCommerce se sustituirán por los datos de Square.','Product sync between WooCommerce and Square is currently unavailable. %s'=>'La sincronización de productos entre WooCommerce y Square no está disponible en este momento. %s','A sync is currently in progress. Please try again later.'=>'Hay actualmente una sincronización en curso. Por favor, inténtalo de nuevo más tarde.','There are currently no products marked to be synced with Square.'=>'En este momento no hay ningún producto marcado para su sincronización con Square.','Please connect to Square to enable product sync.'=>'Por favor, conéctate con Square para activar la sincronización de productos.','%1$sProduct images%2$s will be imported from Square if no featured image is set in WooCommerce.'=>'%1$sLas imágenes de producto%2$s se importarán de Square si no se ha configurado ninguna imagen destacada en WooCommerce.','The product catalog visibility has been set to "hidden", as a matching product could not be found in Square on %1$s at %2$s. %3$sCheck sync records%4$s.'=>'La visibilidad en el catálogo del producto se ha establecido como «oculta», ya que no se pudo encontrar ningún producto que coincida en Square el %1$s a las %2$s. %3$sRevisar los registros sincronizados%4$s.','Updated data for %d product.'=>'Datos actualizados para %d producto.' . "\0" . 'Datos actualizados para %d productos.','Success! You can now sync your products.'=>'¡Lo lograste! Ahora puedes sincronizar tus productos.','This tool will clear any ongoing Square product syncs.'=>'Esta herramienta vaciará cualquier sincronización activa de productos de Square.','You are about to sync products with Square. %1$s is your system of record set in the sync settings. For all products synced with Square: %2$s'=>'Estás a punto de sincronizar productos con Square. %1$s es tu sistema de registro establecido en los ajustes de sincronización. Para todos los productos sincronizados con Square: %2$s','%1$sWooCommerce%2$s is the system of record set in the sync settings. The following data from WooCommerce will overwrite Square data for synced products: %3$sname, price, inventory, category, image%4$s.'=>'%1$sWooCommerce%2$s es el sistema de registro establecido en los ajustes de sincronización. Los siguientes datos de WooCommerce sustituirán los datos de Square en los productos sincronizados: %3$snombre, precio, inventario, categoría, imagen%4$s.','%1$sSquare%2$s is the system of record set in the sync settings. The following data from Square will overwrite WooCommerce data for synced products: %3$sname, price, description, category, inventory%4$s.'=>'%1$sSquare%2$s es el sistema de registro establecido en los ajustes de sincronización. Los siguientes datos de Square sustituirán los datos de WooCommerce en los productos sincronizados: %3$snombre, precio, descripción, categoría, inventario%4$s.','Clear'=>'Limpiar','Square User Data Erased.'=>'Datos de usuario de Square borrados.','By using this extension, you may be storing personal data or sharing data with an external service. %1$sLearn more about how this works, including what you may want to include in your privacy policy.%2$s'=>'Al usar esta extensión puede que estés almacenando datos personales o compartiendo datos con un servicio externo. %1$sAprende más sobre cómo funciona esto, incluido lo que puede que quieras incluir en tu política de privacidad.%2$s','WooCommerce Square Customer Data'=>'Datos de clientes en WooCommerce Square','https://www.woocommerce.com/'=>'https://www.woocommerce.com/','WooCommerce'=>'WooCommerce','https://woocommerce.com/products/square/'=>'https://woocommerce.com/products/square/','WooCommerce Square'=>'WooCommerce Square','Card Number'=>'Número de tarjeta','Description'=>'Descripción','Title'=>'Título','Enable / Disable'=>'Activar / Desactivar','MM / YY'=>'MM / AA','Variation #%1$s of %2$s'=>'Variación #%1$s de %2$s','No'=>'No','Yes'=>'Sí','Connect with Square'=>'Conectar con Square','Disconnect from Square'=>'Desconectar de Square','Sync inventory'=>'Sincronizar inventario','Square'=>'Square','The SKU already exists on another product'=>'El SKU ya existe en otro producto','Missing parameter %s'=>'Falta el parámetro %s','Place order'=>'Realizar el pedido','Invalid product type - the product type must be any of these: %s'=>'Tipo de producto no válido - el tipo debe ser alguno de los siguientes: %s']];